$(document).ready(function(){search_company_result()});function search_company_result(){$(".search").click(function(){var b=$('[name="location"]').val();var c=$('[name="company_type"]').val();var a=$('[name="company_name"]').val();var d=$('input[name="csrfmiddlewaretoken"]').prop("value");$.ajax({url:"/ucjobs/search_company_result",type:"POST",data:{csrfmiddlewaretoken:d,location:b,company_type:c,company_name:a},dataType:"html",success:function(e){$(".result").empty();$(".result").first().prepend(e)}});return false})};